import React, {Component} from 'react';

const data = [
    {img: '/images/perpusci.png', name: 'second'},
    {img: '/images/perpusci.png', name: 'third'},
]

class Portfolio extends Component {
    render() {
        const dataLoop = data.map((value) => {
            return (
                <img src={value.img} alt={value.name} className="img-fluid mt-2 pb-5"/>
            )
        })

        return (
            <section id="portfolio" className="container pb-5">
                <div className="row">
                    <div className="col">
                        <h3 className="h2 text-black-50 pt-5 pb-3">Portfolio</h3>
                        {dataLoop}
                    </div>
                </div>
            </section>
        );
    }
}

export default Portfolio;
